;; gorilla-repl.fileformat = 1

;; **
;;; # Rao-Blackwellization
;;; 
;;; Scoreability of a distribution corresponds to Rao-Blackwellizing our Monte Carlo estimator.
;; **

;; @@
(ns rao-blackwell
  (:require [gorilla-plot.core :as plot])
  (:use clojure.repl
        [anglican core runtime emit [state :only [get-predicts]]]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; We can sample from a geometric distribution by counting the number of independent Bernoulli trials before the first success. We can score this explicitly:
;; **

;; @@
(defdist geometric
  "Geometric distribution on support {0,1,2....}"
  [p] []
  (sample* [this]
          (loop [value 0] 
            (if (sample* (flip p))
              value
              (recur (inc value)))))
  (observe* [this value] (+ (log p) (* value (log (- 1 p))))))


; test
(sample* (geometric 0.2))
(exp (observe* (geometric 0.2) 6))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>0.052428800000000005</span>","value":"0.052428800000000005"}
;; <=

;; **
;;; We're going to compare the difference between using this "collapsed" representation, where we explicitly score the geometric random variable, with an "explicit" representation where we score the individual Bernoulli trials.
;; **

;; @@
(def measurement 4.5)

(defquery noisy-geometric-explicit []
  (let [p (sample (uniform-continuous 0. 1.))
        k (loop [value 0]
            (if (sample (flip p))
              value
              (recur (inc value))))]
    (observe (normal k 0.5) measurement)
    (predict p)
    (predict k)))


(with-primitive-procedures [geometric]
  (defquery noisy-geometric-collapsed []
    (let [p (sample (uniform-continuous 0. 1.))
          k (sample (geometric p))]
      (observe (normal k 1.0) measurement)
      (predict p)
      (predict k))))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;rao-blackwell/noisy-geometric-collapsed</span>","value":"#'rao-blackwell/noisy-geometric-collapsed"}
;; <=

;; @@
(def explicit-query 
  (doquery :lmh noisy-geometric-explicit [] :debug true))

(def collapsed-query 
  (doquery :lmh noisy-geometric-collapsed [] :debug true))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;rao-blackwell/collapsed-query</span>","value":"#'rao-blackwell/collapsed-query"}
;; <=

;; **
;;; Let's compare the behaviour of the two different samplers.
;; **

;; @@
(defn predicted [result sym]
  (map #(get % sym) (map get-predicts result)))

(defn running-mean [N query sym]
  (let [p-vals (predicted (take N query) sym)]
    (loop [means [(first p-vals)]
           p-vals (rest p-vals)
           n 1.0]
      (if (empty? p-vals) 
        means
        (recur (conj means (/ (+ (first p-vals) 
                                 (* n (last means)))
                              (inc n)))
               (rest p-vals) 
               (inc n))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;rao-blackwell/running-mean</span>","value":"#'rao-blackwell/running-mean"}
;; <=

;; @@
(def num-samples 10000)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;rao-blackwell/num-samples</span>","value":"#'rao-blackwell/num-samples"}
;; <=

;; **
;;; The "collapsed" version, in RED, mixes more through the space.
;; **

;; @@
(plot/compose
  (plot/list-plot (predicted (take num-samples explicit-query) 'k) :color "#0000ff" :joined true
                  :plot-range [[0 num-samples] [0.0 8]])
  (plot/list-plot (predicted (take num-samples collapsed-query) 'k) :color "#ff0000" :joined true))

